import React from 'react'
import { Link } from 'react-router-dom'


const NavBar = () => {
  const {isAuth} = use
  return (
    <div>
      <Link to ='/home'>Home</Link>
      <Link to ='/login'>Login</Link>
      <Link to ='/register'>Register</Link>
    </div>
  )
}

export default NavBar
